tables.table_schema:
CREATE TABLE model_results (
    id INT PRIMARY KEY,
    model_name TEXT,
    result JSONB,
    prediction TEXT
);

CREATE TABLE model_predictions (
    id INT PRIMARY KEY,
    model_name TEXT,
    input_data JSONB,
    output_data JSONB
);

CREATE TABLE model_info (
    id INT PRIMARY KEY,
    model_name TEXT,
    training_data JSONB,
    model_description TEXT
);

CREATE TABLE model_results (
    id UUID PRIMARY KEY,
    model_name TEXT,
    result_json JSONB,
    created_at TIMESTAMPTZ
);

CREATE TABLE model_metadata (
    model_id UUID PRIMARY KEY REFERENCES model_results(id),
    metadata_key TEXT,
    metadata_value TEXT,
    created_at TIMESTAMPTZ
);

CREATE TABLE machine_learning_models (
    id INT PRIMARY KEY,
    model_name VARCHAR(50),
    accuracy DECIMAL(5, 2),
    trained_date DATE
);

CREATE TABLE predictions (
    id INT PRIMARY KEY,
    prediction_date DATE,
    input_data JSON,
    model_id INT,
    result VARCHAR(50)
);

CREATE TABLE model_evaluation (
    id INT PRIMARY KEY,
    evaluation_date DATE,
    model_id INT,
    evaluation_result VARCHAR(50)
);

CREATE TABLE training_data (
    id INT PRIMARY KEY,
    data_date DATE,
    model_id INT,
    training_data JSON
);

CREATE TABLE model_parameters (
    id INT PRIMARY KEY,
    model_id INT,
    parameter_name VARCHAR(50),
    parameter_value DECIMAL(5, 2)
);
